import Head from 'next/head';
const Layout =(props) => {
    return(
        <div>
            <Head>
                <title>ReactJS Woo</title>
                <link rel="stylesheet" href="https://bootswatch.com/3/superhero/bootstrap.min.css"></link>
            </Head>
            {props.children}
        </div>
    )
};

export default Layout;
